vulner.description:
SMB signing is not mandatory on the host. It allows a malicious person to conduct a "man in the middle" attack against the SMB server.
There are three options concerning SMB signing in the SMB server configuration:
1) SMB signing is enabled and mandatory for all clients;
2) SMB signing is enabled but not mandatory for all clients;
3) SMB signing is disabled.
Only the first option (SMB signing enabled and mandatory) is considered to be secure. This host uses an insecure SMB signing option.
